import styled from 'styled-components'

const RedAsterisk = styled.span`
  position: absolute;
  margin: -0.9rem 0 0 -0.575rem;
  font-size: 1.5625rem;
  color: ${props => props.theme.colors.red};
`;

export default RedAsterisk
